        "parameters": [
          {
            "type": "integer",
            "name": "skip",
            "in": "query",
            "required": true,
            "format": "int32"
          },
          {
            "type": "integer",
            "name": "take",
            "in": "query",
            "required": true,
            "format": "int32"
          },
          {
            "type": "string",
            "name": "searchText",
            "in": "query"
          }
        ],
        "responses": {
          "200": {
            "description": "OK",
            "schema": {
              "$ref": "#/definitions/PageResultDto[FolderDto]"
            }
          }
        }
      }
    },
