          "maximum": 10000.0,
          "minimum": 1.0
        },
        "MaxJobsForActivation": {
          "type": "integer",
          "description": "The maximum number of jobs that a process can create as result of a Queue driven activation.",
          "format": "int32",
          "maximum": 10000.0,
          "minimum": 1.0
        },
        "Id": {
          "type": "integer",
          "format": "int64"
        }
      }
